import React from "react";
import "./DietaryIcon.css"; // Archivo CSS para estilos personalizados.

// Importación de íconos con `require` para asegurar compatibilidad con Webpack
const dietaryIcons = {
  // Restricciones Dietéticas
  vegetarian: require("../icons/vegetarian.png"),
  vegan: require("../icons/vegan.png"),
  pescatarian: require("../icons/contains_fish.png"),
  ketogenic: require("../icons/keto.png"),
  paleo: require("../icons/paleo.png"),
  primal: require("../icons/primal.png"),
  whole30: require("../icons/whole30.png"),
  lowCarb: require("../icons/low_carb.png"),
  lowFat: require("../icons/low_fat.png"),
  sugarConscious: require("../icons/sugar_conscious.png"),

  // Intolerancias y Alérgenos
  glutenFree: require("../icons/gluten_free.png"),
  eggFree: require("../icons/egg_free.png"),
  peanutFree: require("../icons/no_nuts.png"),
  treeNutFree: require("../icons/tree-nut-free.png"),
  soyFree: require("../icons/soy_free.png"),
  fishFree: require("../icons/fish_free.png"),
  wheatFree: require("../icons/wheat_free.png"),
  sesameFree: require("../icons/sesame_free.png"),
  sulfiteFree: require("../icons/sulfit_free.png"),
  celeryFree: require("../icons/celery_free.png"),
  mustardFree: require("../icons/mustard_free.png"),
  lupinFree: require("../icons/lupin_free.png"),
  molluskFree: require("../icons/mollusk_free.png"),

  // Ícono genérico
  default: require("../icons/default.png"),
};

const DietaryIcon = ({ diet }) => {
  const icon = dietaryIcons[diet] || dietaryIcons.default; // Ícono por defecto si no se encuentra el especificado.
  return (
    <div className="dietary-icon">
      <img src={icon} alt={diet} className="icon-image" />
      <span>{diet}</span>
    </div>
  );
};

export default DietaryIcon;
